import React from 'react'
import {
  Card,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  CardFooter,
  Button,
  Container,
} from "reactstrap";

function Course (){
   
    return (
      <Card>
        <CardSubtitle>Java Course</CardSubtitle>
        <CardText className="font-weight-bold">
          This is Java course for students with all the concepts
        </CardText>
        <Container className="text-center">
          <Button className="danger">Delete</Button>
          <Button className="secondary">Update</Button>
        </Container>
      </Card>
    );
}

export default Course;
